import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div className="container-fluid">
      <div className="row home">
        <div className="col-sm-12 home-heading">
          <h1 className="home-heading">Welcome to Wizz</h1>
        </div>
        <div className="col-sm-12">
          <Link to="/login" className="btn btn-block btn-social btn-google">
            <span className="fa fa-google"></span>
            Log in with Google.
          </Link>
        </div>
        <div className="col-sm-12">
            <h4>Dont have an account? <Link to="/signup" className="sign-up-button"> Sign Up </Link></h4>
        </div>
      </div>
    </div>
    // <Container fluid>
    //   <Row className="home">
    //     <Col xs={12} className="home-heading">
    //       <h1>Welcome to Wizz!</h1>
    //     </Col>
    //     <Col xs={12}>
    //       <Link to="/login"> Log In </Link>
    //     </Col>
    //     <Col xs={12}>
    //       <p>Don't have an account? Sign Up with Google!</p>
    //       <Link to="/signup"> Sign Up </Link>
    //     </Col>
    //   </Row>
    // </Container>
  );
}

export default Home;
